import React, { Component } from 'react';


export default class Home extends Component {
    render() {
        return (
            <div style={formStyle}>
                <h2>Honest Feedback</h2>
                <form>
                    {/* Subject line */}
                    <label style={subjectStyle}>Subject</label> <br />
                    <input type="text" id="submitForm" /> <br />

                    {/* Feedback section */}
                    <label style={feedbackStyle}>Feedback</label><br />
                    <textarea id="feedbackForm"
                    rows={10}
                    cols={70} />

                    {/* Submit Button */}
                    <button>Submit</button>
                </form>
            </div>
        )
    }
}

const formStyle = {
    display: 'grid',
    placeItems: 'center',
    height: '15vh',
    // width: '100vh',
}

const subjectStyle = {
    fontSize: '2rem',

}

const feedbackStyle = {
    fontSize: '2rem',
}
